import React, { Component } from 'react'
import QuickSearches from './QuickSearches'
import Wallpaper from './Wallpaper'
import axios from 'axios'

export class Home extends Component {
    constructor(props) {
        super(props);
        this.state = {
            location: [],
            mealType: []
        }
    }

    componentDidMount() {
        axios(
            {
                method: 'GET',
                url: 'http://localhost:3000/city/getcitylist',
                headers: { 'Content-Type': 'application/json' }
            }
        ).then(response => this.setState({ location: response.data })).catch()
        axios(
            {
                method: 'GET',
                url: 'http://localhost:3000/meals/getAllmeals',
                headers: { 'Content-Type': 'application/json' }
            }
        ).then(response => this.setState({ mealType: response.data })).catch()
    }

    render() {
        const { location, mealType } = this.state;
        return (
            <>
                <Wallpaper locationValues={location} />
                <QuickSearches quicksearch={mealType} />
            </>
        )
    }
}

export default Home;
